INSERT INTO `dictionary` VALUES (9417, 'integer', 'Max-All-Session', NULL, NULL, 'dictionary.daloradius', ':=', 'check', NULL, 'Specifies the number of seconds in total (the counter never resets) for which the user may connect (very popular with prepaid accounts). Please notice that this attribute is internal to FreeRADIUS and is based on a respective sql module configuration in radiusd.conf');
INSERT INTO `dictionary` VALUES (9418, 'integer', 'Max-Daily-Session', NULL, NULL, 'dictionary.daloradius', ':=', 'check', NULL, 'Specifies the number of seconds (the counter resets daily) for which the user may connect each day (very popular with prepaid accounts). Please notice that this attribute is internal to FreeRADIUS and is based on a respective sql module configuration in radiusd.conf');
INSERT INTO `dictionary` VALUES (9419, 'integer', 'Max-Monthly-Session', NULL, NULL, 'dictionary.daloradius', ':=', 'check', NULL, 'Specifies the number of seconds (the counter resets monthly) for which the user may connect each month in total (very popular with prepaid accounts). Please notice that this attribute is internal to FreeRADIUS and is based on a respective sql module configuration in radiusd.conf');
INSERT INTO `dictionary` VALUES (9420, 'integer', 'Access-Period', NULL, NULL, 'dictionary.daloradius', ':=', 'check', NULL, 'Setting the number of seconds (e.g. X seconds) of this attribute for a user allows the user to log in only for the next X seconds specified. In other words, unlike Max-All-Session, this is NOT an attribute based on accumulated time, but rather a Time-To-Finish.');
INSERT INTO `dictionary` VALUES (9421, 'integer', 'Max-Weekly-Session', NULL, NULL, 'dictionary.daloradius', ':=', 'check', NULL, 'Specifies the number of seconds (the counter resets weekly) for which the user may connect each week (very popular with prepaid accounts). Please notice that this attribute is internal to FreeRADIUS and is based on a respective sql module configuration in radiusd.conf');
INSERT INTO `dictionary` VALUES (9422, 'integer', 'Max-Quaterly-Session', NULL, NULL, 'dictionary.daloradius', ':=', 'check', NULL, 'Specifies the number of seconds (the counter resets quarterly) for which the user may connect each quarter of a year (very popular with prepaid accounts). Please notice that this attribute is internal to FreeRADIUS and is based on a respective sql module configuration in radiusd.conf');
INSERT INTO `dictionary` VALUES (9423, 'integer', 'Max-Yearly-Session', NULL, NULL, 'dictionary.daloradius', ':=', 'check', NULL, 'Specifies the number of seconds (the counter resets yearly) for which the user may connect each year (very popular with prepaid accounts). Please notice that this attribute is internal to FreeRADIUS and is based on a respective sql module configuration in radiusd.conf');
